import logo from './logo.svg';
import './styles/App.css';
import Navbar from './containers/navbar'
import CdCollection from './containers/cdcontainer'
import {BrowserRouter as Router, Link, Route} from 'react-router-dom'

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <CdCollection />

      </div>
    </Router>
  );
}

export default App;
